extern inline uint8_t mq_2_8_mul(uint8_t a, uint8_t b);

// Given a block consisting of MQ_GF_BITS blocks of length SECURITY_PARAM / MQ_GF_BITS, interpret
// it as a polynomial over GF(2^MQ_GF_BITS) by letting the ith coefficient be the ith bits collected
// from all blocks. GF(2^SECURITY_PARAM) is isomorphic to a degree SECURITY_PARAM / MQ_GF_BITS field
// extension of GF(2^MQ_GF_BITS), and this function applies this transformation to get an element of
// GF(2^SECURITY_PARAM).
static block_secpar mq_field_vec_to_gfsecpar_bitsliced(block_secpar in)
{
#if defined(OWF_MQ_2_1)
	// Trivial: our input can already be viewed as a degree SECURITY_PARAM polynomial over GF(2).
	return in;

#elif defined(OWF_MQ_2_8)
	poly64_vec coeffs[8];
	for (size_t j = 0; j < 8; ++j)
	{
		size_t block_size = SECURITY_PARAM / (8 * 8);
		uint32_t block = 0;
		memcpy(&block, ((uint8_t*) &in) + block_size * j, block_size);
		coeffs[j] = poly64_set_low32(block);
	}

	block_secpar out;
	poly_secpar_store1(&out, poly_secpar_from_8_poly64(coeffs));
	return out;

#else
#error "Invalid MQ field size."
#endif
}

// This is the same as mq_field_vec_to_gfsecpar_bitsliced, except that the input is not bit sliced.
// That is, it consists of SECURITY_PARAM / MQ_GF_BITS blocks of MQ_GF_BITS bits each, and the ith
// block represents the ith coefficient.
static block_secpar mq_field_vec_to_gfsecpar(block_secpar in)
{
#if defined(OWF_MQ_2_1)
	// Trivial: our input can already be viewed as a degree SECURITY_PARAM polynomial over GF(2).
	return in;

#elif defined(OWF_MQ_2_8)
	// First, we need to do a transpose to bitslice the input.
#if SECURITY_PARAM == 128
	block_secpar transposed = transpose16x8_1(in);
#elif SECURITY_PARAM == 192
	block_secpar transposed = transpose24x8_1(in);
#elif SECURITY_PARAM == 256
	block_secpar transposed = transpose32x8_1(in);
#endif

	return mq_field_vec_to_gfsecpar_bitsliced(transposed);
#endif
}

#if defined(OWF_MQ_2_8)
// bit matrix representing the linear transformation in mq_field_vec_from_gfsecpar. Stored in
// column-major order.
static unsigned char mq_field_vec_from_gfsecpar_matrix[SECURITY_PARAM][SECURITY_PARAM / 8];
#endif

// The inverse of mq_field_vec_to_gfsecpar.
static block_secpar mq_field_vec_from_gfsecpar(block_secpar in)
{
#if defined(OWF_MQ_2_1)
	// Trivial: our input can already be viewed as a degree SECURITY_PARAM polynomial over GF(2).
	return in;

#elif defined(OWF_MQ_2_8)
	uint8_t in_bytes[sizeof(in)];
	memcpy(in_bytes, &in, sizeof(in));

	block_secpar out = block_secpar_set_zero();
	for (int i = 0; i < SECURITY_PARAM; ++i)
	{
		block_secpar col;
		memcpy(&col, mq_field_vec_from_gfsecpar_matrix[i], sizeof(col));
		uint8_t bit = (in_bytes[i / 8] >> (i % 8)) & 1;
		block_secpar mask = block_secpar_set_all_8(-bit);
		out = block_secpar_xor(out, block_secpar_and(mask, col));
	}

	return out;
#endif
}

static void mq_initialize_A_b(block_secpar seed, block_secpar* A_b)
{
	#define MQ_A_B_BLOCK128S (MQ_A_B_LENGTH * SECURITY_PARAM / 128)
	static_assert((MQ_A_B_LENGTH * SECURITY_PARAM) % 128 == 0,
	              "mq_initialize_A_b assumes a whole number of AES blocks.");
	static_assert(MQ_A_B_BLOCK128S < UINT32_MAX,
	              "mq_initialize_A_b: too many blocks.");
	static_assert((MQ_M * MQ_GF_BITS) % 8 == 0,
	              "mq_initialize_A_b assumes the MQ instance is a whole number of bytes");

	aes_round_keys aes;
	aes_keygen(&aes, seed);
	aes.iv = block128_set_zero();
	size_t i;
	for (i = 0; i + AES_PREFERRED_WIDTH <= MQ_A_B_BLOCK128S; i += AES_PREFERRED_WIDTH)
	{
		block128 ctr_output[AES_PREFERRED_WIDTH];
		aes_ctr(&aes, 1, AES_PREFERRED_WIDTH, i, &ctr_output[0]);
		memcpy((char*) (&A_b[0]) + 16 * i, &ctr_output[0], sizeof(ctr_output));
	}

	size_t remainder = MQ_A_B_BLOCK128S % AES_PREFERRED_WIDTH;
	if (remainder)
	{
		block128 ctr_output[AES_PREFERRED_WIDTH];
		aes_ctr(&aes, 1, remainder, i, &ctr_output[0]);
		memcpy((char*) (&A_b[0]) + 16 * i, &ctr_output[0], remainder * sizeof(block128));
	}

	// Build the bit mask that will select which random bits to keep before running
	// mq_field_vec_to_gfsecpar_bitsliced. Should be converted to a constant by the compiler.
	block_secpar mask;

	size_t final_block_size = MQ_M % (SECURITY_PARAM / MQ_GF_BITS);
	uint8_t mask_arr[sizeof(mask)];
	memset(mask_arr, 0, sizeof(mask_arr));
	#ifdef __GNUC__
	#pragma GCC unroll (16)
	#endif
	for (i = 0; i < MQ_GF_BITS; ++i)
	{
		#ifdef __GNUC__
		#pragma GCC unroll (256)
		#endif
		for (size_t j = 0; j < final_block_size; ++j)
		{
			size_t bit_idx = i * (SECURITY_PARAM / MQ_GF_BITS) + j;
			mask_arr[bit_idx / 8] |= 1 << (bit_idx % 8);
		}
	}
	memcpy(&mask, &mask_arr[0], sizeof(mask));

	for (i = 0; i < MQ_A_B_LENGTH / OWF_NUM_CONSTRAINTS; ++i)
	{
		// Convert the column of OWF_NUM_CONSTRAINTS block_secpars into a random vector in a MQ_M
		// dimensional vector space over GF(2^MQ_GF_BITS). For all but the last block, the full
		// vector space is used, and so nothing needs to be done.
		block_secpar* last_block = &A_b[(i + 1) * OWF_NUM_CONSTRAINTS - 1];

		if ((MQ_M * MQ_GF_BITS) % SECURITY_PARAM == 0)
			// Last block is not partial, so there's nothing to do.
			continue;

		// Interpret the last block as a polynomial over GF(2^MQ_GF_BITS) of
		// degree < MQ_M % (SECURITY_PARAM / MQ_GF_BITS), and convert it into into an element of
		// GF(2^SECURITY_PARAM). Each coefficient of the polynomial is sliced across the MQ_GF_BITS
		// blocks of length (SECURITY_PARAM / MQ_GF_BITS).
		*last_block = mq_field_vec_to_gfsecpar_bitsliced(block_secpar_and(*last_block, mask));
	}
}

void mq_initialize_pk(block_secpar seed, const uint8_t* y, block_secpar* A_b, poly_secpar_vec* y_gfsecpar)
{
	mq_initialize_A_b(seed, A_b);

	for (size_t i = 0; i < OWF_NUM_CONSTRAINTS; ++i)
	{
		if (i < OWF_NUM_CONSTRAINTS - 1 || (MQ_M * MQ_GF_BITS) % SECURITY_PARAM == 0)
			// Just load the full blocks directly, without bothering to convert representations.
			y_gfsecpar[i] = poly_secpar_load_dup(&y[i * sizeof(block_secpar)]);
		else
		{
			// Convert from GF(2**MQ_GF_BITS) representation.
			block_secpar y_tmp = block_secpar_set_zero();
			memcpy(&y_tmp, &y[i * sizeof(block_secpar)], MQ_N_BYTES % (SECURITY_PARAM / 8));
			y_tmp = mq_field_vec_to_gfsecpar(y_tmp);
			y_gfsecpar[i] = poly_secpar_load_dup(&y_tmp);
		}
	}
}

void mq_initialize(const uint8_t* x, block_secpar seed, block_secpar* A_b, poly_secpar_vec* y_gfsecpar, uint8_t* y)
{
	mq_initialize_A_b(seed, A_b);

#if defined(OWF_MQ_2_1)
	poly1_vec key[MQ_M];
	for (size_t k = 0; k < MQ_M; ++k)
		key[k] = poly1_load(x[k / 8], k % 8);
#elif defined(OWF_MQ_2_8)
	poly_secpar_vec key[MQ_M];
	for (size_t k = 0; k < MQ_M; ++k)
		key[k] = poly_secpar_from_byte(x[k]);
#endif

	bool skip_diag = (MQ_GF_BITS == 1);

	for (size_t i = 0; i < OWF_NUM_CONSTRAINTS; ++i)
	{
		poly_secpar_vec Ax_plus_b[MQ_M];

		const block_secpar* A_b_i = A_b + i;
		for (size_t j = 0; j < MQ_M; ++j)
		{
			// b is interleaved with A, with b always being the first entry of the row.
			poly_secpar_vec b_j = poly_secpar_load_dup(A_b_i);
			A_b_i += OWF_NUM_CONSTRAINTS;

#if defined(OWF_MQ_2_1)
			poly_secpar_vec Ax_plus_b_j = b_j;
#else
			poly_2secpar_vec Ax_plus_b_j = poly_2secpar_from_secpar(b_j);
#endif

			// Only the upper triangle is stored, so k should start from j (+1 for strictly upper
			// triangular).
			for (size_t k = j + skip_diag; k < MQ_M; ++k, A_b_i += OWF_NUM_CONSTRAINTS)
			{
				poly_secpar_vec A_jk = poly_secpar_load_dup(A_b_i);
#if defined(OWF_MQ_2_1)
				Ax_plus_b_j = poly_secpar_add(Ax_plus_b_j, poly1xsecpar_mul(key[k], A_jk));
#else
				Ax_plus_b_j = poly_2secpar_add(Ax_plus_b_j, poly_secpar_mul(key[k], A_jk));
#endif
			}

#if defined(OWF_MQ_2_1)
			Ax_plus_b[j] = Ax_plus_b_j;
#else
			Ax_plus_b[j] = poly_2secpar_reduce_secpar(Ax_plus_b_j);
#endif
		}

#if defined(OWF_MQ_2_1)
		poly_secpar_vec y_secpar_i = poly_secpar_set_zero();
		for (size_t k = 0; k < MQ_M; ++k)
			y_secpar_i = poly_secpar_add(y_secpar_i, poly1xsecpar_mul(key[k], Ax_plus_b[k]));
		y_gfsecpar[i] = y_secpar_i;

#else
		poly_2secpar_vec y_secpar_i = poly_2secpar_set_zero();
		for (size_t k = 0; k < MQ_M; ++k)
			y_secpar_i = poly_2secpar_add(y_secpar_i, poly_secpar_mul(key[k], Ax_plus_b[k]));
		y_gfsecpar[i] = poly_2secpar_reduce_secpar(y_secpar_i);
#endif
	}

	for (size_t i = 0; i < OWF_NUM_CONSTRAINTS; ++i)
	{
		if (i < OWF_NUM_CONSTRAINTS - 1 || (MQ_M * MQ_GF_BITS) % SECURITY_PARAM == 0)
			// Just store a full block of output, without bothering to convert representations.
			poly_secpar_store1(&y[i * sizeof(block_secpar)], y_gfsecpar[i]);
		else
		{
			block_secpar y_tmp;
			poly_secpar_store1(&y_tmp, y_gfsecpar[i]);

			// Convert back to GF(2**MQ_GF_BITS) representation, so that we can just drop the last
			// few bytes (which should always be 0) to fit it into y.
			y_tmp = mq_field_vec_from_gfsecpar(y_tmp);
			memcpy(&y[i * sizeof(block_secpar)], &y_tmp, MQ_N_BYTES % (SECURITY_PARAM / 8));
		}
	}
}

